import React from "react";
import { Redirect } from "react-router";

import Header from "./Header";
import Menu from "./Menu";

class Main extends React.Component {
  render() {
    const { props } = this;

    if (!props.isLoggedIn) {
      return <Redirect to="/login" />;
    }

    return (
      <>
        <Header props={props} />
        <Menu />
      </>
    );
  }
}

export default Main;
